"use strict";(self.webpackChunkdocs_next=self.webpackChunkdocs_next||[]).push([[53955],{42441:e=>{e.exports=JSON.parse('{"tag":{"label":"aerospace","permalink":"/docs-next/pr-preview/pr-296/docs/tags/aerospace","allTagsPath":"/docs-next/pr-preview/pr-296/docs/tags","count":1,"items":[{"id":"blueprints/by-industry/aerospace/cloud-satellite-data-mundi-web-services","title":"Mundi Web Services: New Business from Space","description":"The European Space Agency\'s (ESA) Copernicus program fulfills the mandate of the European Union to place a series of sentinel earth observation satellites in orbit that transmit about 20 terabytes of images to Earth every day. By now, the previously available satellites have generated several petabytes of data, giving users inside and outside the EU new glimpses from the cosmos. This data is made accessible in a cloud-based manner via Mundi Web Services. The aim is to promote new geo-based business models.","permalink":"/docs-next/pr-preview/pr-296/docs/blueprints/by-industry/aerospace/cloud-satellite-data-mundi-web-services"}],"unlisted":false}}')}}]);